const icon = "data:image/svg+xml;base64,";
const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const Variable = require('../../engine/variable');
const formatMessage = require('format-message');


class Scratch3TSP
{
    constructor (runtime)
    {
        this.runtime = runtime;
    }

    getInfo ()
    {

        return {
            id: 'TSP',
            name: formatMessage({
                id: 'TSP.tsp',
                default: 'TSP',
                description: 'Label for the Music extension category'
            }),
            menuIconURI: icon,
            blockIconURI: icon,

            color1: '#615bd7',
            color2: '#9c98e6',
            color3: '#1d1967',

            blocks: [
                {
                    id: 'Command',
                    opcode: 'command',
                    blockType: BlockType.COMMAND,
                    description: 'runs the operation',
                    text: 'Destinations [D_TEXT] Result [B_Path]',
                    arguments:
                    {
                        D_TEXT:
                        {
                            type: ArgumentType.LIST,
                        },
                        B_Path:
                        {
                            type: ArgumentType.STRING,
                            defaultValue: 'Result-List Name'
                        },
                    }
                },
                {
                    opcode: 'getDistance',
                    text: 'Distance',
                    id: 'TSP.Distance',
                    description: 'get the total distance',
                    blockType: BlockType.REPORTER,
                },
                {
                    opcode: 'getPossibilities',
                    text: 'Possibilities',
                    id: 'TSP.Possibilities',
                    description: 'get the total possibilities',
                    blockType: BlockType.REPORTER,
                },
            ],
        };
    }

    command (args, util)
    {
        var text = args.D_TEXT;
        if (text == undefined)
        {
            return 'Destinations Undefined'
        }
        else if (text.length > 3)
        {
            //To get rid of characters keeping just numbers
            text = text.replace(/[^0-9 .]/g, '');
            //END

            //Comparing the characters and indexes
            //If both match, means that single digit values are given
            //Separated after every single value

            //Otherwise, double digit values are given,
            //which can be separated when a whitespace is found
            temp = text.split(" ");
            if (temp.length == 1 &&  text.length != 1)
            {
                text = text.split('');
            }
            else
            {
                text = text.split(" ");
            }

            
            //Length of the list is taken as the square root of length
            //So, if the list is 25, which means only 5 destinations are given
            var length = Math.sqrt(text.length);
            var result = text.map(i=>Number(i));

            let assetData;
            try
            {
                
                //Array and Number of destinations are passed to the Algorithm
                assetData = require('./brute_force.js');
                assetData.Tsp(result, length);
                bestPath = assetData.getPath();

                //The name of the given list (as an input) is stored,
                //so we can find the list using the build-in function
                list_name = args.B_Path;

                list = util.target.lookupVariableByNameAndType(list_name, Variable.LIST_TYPE);
                if (list)
                {
                    for(var i = 0; i < bestPath.length; i++)
                    {
                        list.value.push(bestPath[i]);
                        list._monitorUpToDate = true;
                    }
                }
                else
                {
                    return 'Result List Error';
                }


            } catch (e) 
            {
                // console.log(e);
                // Catch Problems and output to console if needed
            }
        }
        else
        {
            return 'Values must be more than 3'
        }
        
    }

    getPossibilities()
    {
        let assetData;
        try
        {
            assetData = require('./brute_force.js');
            possibilities = assetData.getPossibilities();
            return possibilities;
        }
        catch (e)
        {
            // console.log(e);
            // Catch Problems and output to console if needed
        }
    }

    getDistance()
    {
        let assetData;
        try
        {
            assetData = require('./brute_force.js');
            distanceValue = assetData.getDistance();
        } 
        catch (e)
        {
            // console.log(e);
            // Catch Problems and output to console if needed
        }
        if(distanceValue)
        {
            return distanceValue;
        }
        else
        {
            return 0.0;
        }
    }

}

module.exports = Scratch3TSP;